<style>
    @import url('https://fonts.googleapis.com/css2?family=Quicksand&display=swap');
    @import url('https://fonts.googleapis.com/css2?family=Raleway:wght@300&display=swap');
    @import url('https://fonts.googleapis.com/css2?family=Comfortaa:wght@300&display=swap');

    body{
        width: 100%;
        height: 100vh;
        overflow: hidden;
        display: flex;
        align-items: center;
        justify-content: center;
        background-color: lightpink;
    }

    .container{
        width: 210px;
        height: 500px;
        background-color: lightblue;
        border: 0px;
        border-radius: 10px;
    }

    .happy-birthday{
        font-family: 'Quicksand', sans-serif;
    }

    .quot{
        white-space: pre;
        font-family: 'Raleway', sans-serif;
    }

    .btn{
        border: 0px;
        background-color: lightgreen;
        padding: 10px;
        border-radius: 50px;
        width: 190px;
        cursor: pointer;
        margin-top: 30px;
        font-family: 'Comfortaa', cursive;
    }

    *{
        outline: none;
        transition: all .50s linear;
        -webkit-tap-highlight-color: transition;
    }
</style>

<script>
    var song = document.querySelector('.song');
    function surprise(){
        if (song.paused) {
            song.play();
        } else {
            song.pause();
        }
    }

    window.onload=function(){
        var url = window.location.search;
        if (url.startsWith('?name=') && url.includes('&')==false){
            name=url.split('?')
            name=name.split('=')[1]
            if (name.trim()!=""){
                name=name.replace('%20', ' ').replace('+', ' ');
                if (name.includes(' ')){name=name.split(' ')[0]}
                else{}
                document.querySelector('title').innerHTML=`Happy Birthday ${name}!`;
                document.querySelector('.happy-birthday').innerHTML=`Happy Birthday ${name}!`;
                document.querySelector('.quot').innerHTML=`Hey ${name},
Today you go
one step
forward in life!
Enjoy every
Moment of your
Birthday as it is
celebrated only
once a year!
             
            -Sancho Godinho`;
            }

            else{
                window.location.href='https://sancho1952007.github.io/Birthday-Card-Generator/index.html';
            }
        }

        else{
            window.location.href='https://sancho1952007.github.io/Birthday-Card-Generator/index.html';
        }
    }
</script>
